Healthcare providers should prioritize #COVID19 tests to the following groups:

I. Symptomatic hospitalized patients;
II. Symptomatic patients and staff in congregate living facilities
III. Symptomatic medical personnel, healthcare workers, law enforcement, and first responders;

RELEASE: Two additional positive cases of #COVID19 have been identified in Maryland. The state now has five total confirmed cases of novel coronavirus. 

@GovLarryHogan will hold a press conference tomorrow at 3:30 p.m. to provide an update.

https://t.co/RMghQ5Qz5i https://t.co/kXKeFXyEjd

At this time, there are no confirmed cases of #COVID19 in Maryland.

@MDHealthDept will communicate with the public as the situation develops, providing updates and accurate information about how to protect yourself and your family.

What you need to know: https://t.co/7Jt4qvkuiF https://t.co/X5WEFehNVp

